import { HomeBar } from "./components/toolbar";

import { Grid, Typography, Paper } from "@mui/material";

import { useRef } from "react";

import face from "./IMG_6722.JPG"

function App() {
  let about_scroller = useRef()
  let projects_scroller = useRef()
  // <Typography sx={{fontFamily:"Helvetica", mt:2, mx:2}} variant="body">about</Typography>
  return(
    <>
    <HomeBar about={about_scroller} projects={projects_scroller} />
    <Grid container columns={12} sx={{mx:4, my:2}}>
      <Grid item ref={about_scroller} xs={12} >
        <Grid container columns={14} justifyContent="center" sx={{mx:4, my:2}}>
          <Grid item xs={5}>
            <Typography sx={{fontFamily:"Helvetica", mb:1}} variant="h4" component="h4">Nathan Monette</Typography>
            <Typography sx={{fontFamily:"Helvetica", fontSize:12}} variant="body" component="div">
              Hi! I'm currently an undergraduate at the University of California Irvine, pursuing a B.S. in Computer Science with a minor in Mathematics.
              I specialize in Intelligent Systems, which is UCI's AI/ML emphasis. I support that emphasis with research in Algorithmic Game Theory and
              Multi-Agent Reinforcment Learning, 
            </Typography>
          </Grid>
          <Grid item xs={5}><img src={face} alt="facePic" style={{width:400, height:400}} /></Grid>
        </Grid>
      </Grid>
      <Grid item ref={about_scroller} xs={12}>
        <Typography sx={{fontFamily:"Helvetica", mt:2, mx:2}} variant="body">projects</Typography>
      </Grid>
    </Grid>
    </>
  )
}

export default App;
